// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

library PriceConverter {
    function getPrice() internal view returns (uint256) {
        // Avalanche AVAX / USD Address
        // https://docs.chain.link/docs/data-feeds/price-feeds/addresses/?network=avalanche
        AggregatorV3Interface priceFeed = AggregatorV3Interface(
            0x155835C5755205597d62703a5A0b37e57a26Ee5C
        );
        (, int256 answer, , , ) = priceFeed.latestRoundData();
        // AVAX/USD rate in 18 digit
        return uint256(answer * 10000000000);
    }

    // 1000000000
    function getConversionRate(uint256 avaxAmount)
        internal
        view
        returns (uint256)
    {
        uint256 avaxPrice = getPrice();
        uint256 avaxAmountInUsd = (avaxPrice * avaxAmount) / 1000000000000000000;
        // the actual ETH/USD conversion rate, after adjusting the extra 0s.
        return avaxAmountInUsd;
    }
}

